import React, { Fragment, useState } from "react";
import ReactDom from "react-dom";
import "./Modal.css";

function SignUpModal(props) {
  const [userDefaultStyle, setUserDefaultStyle] = useState({});
  const [pwDefaultStyle, setPwDefaultState] = useState({});

  const [emailInserted, setEmailInserted] = useState("");
  const [pwInserted, setPwInserted] = useState("");

  if (!props.statusTunnel) {
    return;
  }

  let userListener = function (e) {
    setEmailInserted(e.target.value);
    if (emailInserted.length == 0) {
      setUserDefaultStyle({});
    }
  };

  let pwListener = function (e) {
    setPwInserted(e.target.value);
    if (pwInserted.length == 0) {
      setPwDefaultState({});
    }
  };

  const clicker = function () {
    if (emailInserted.length == 0 && pwInserted.length == 0) {
      setUserDefaultStyle({ background: "black" });
      setPwDefaultState({ background: "black" });
    }
    if (emailInserted.length == 0 && pwInserted.length == 0) {
      setUserDefaultStyle({ background: "black" });
    }
  };

  return ReactDom.createPortal(
    <div className="modal-wrapper">
      <form>
        <div>
          <label for="uname">
            <b>Username</b>
          </label>
          <input
            style={userDefaultStyle}
            type="text"
            placeholder=""
            name="uname"
            onChange={userListener}
            required
          />
        </div>
        <div>
          <label for="psw">
            <b>Password</b>
          </label>
          <input
            style={pwDefaultStyle}
            type="password"
            placeholder=""
            name="psw"
            onChange={pwListener}
            required
          />
        </div>
        <button type="submit" onClick={clicker}>
          Sign Up
        </button>
      </form>
      <div className="alert-title">
        Do you have an account already? Then you are ready to{" "}
        <button onClick={props.changerTunnel}>login!</button>
      </div>
    </div>,
    document.getElementById("modal2")
  );
}

export default SignUpModal;
